import networkx as nx
import numpy as np

def add_to_nx_graph_tocheckaccess(G,parameter_importance):
    has_A = len([x for x in parameter_importance if
                parameter_importance[1] > 0 or parameter_importance[2] > 0 or parameter_importance[3] > 0]) > 0
    has_N = len([x for x in parameter_importance if
                parameter_importance[7] > 0 or parameter_importance[8] > 0 or parameter_importance[9] > 0]) > 0
    has_A2 = len([x for x in parameter_importance if
                parameter_importance[13] > 0 or parameter_importance[14] > 0 or parameter_importance[15] > 0]) > 0
    has_Y = len([x for x in parameter_importance if
                parameter_importance[19] > 0 or parameter_importance[20] > 0 or parameter_importance[21] > 0]) > 0
    nameA = 'A'
    nameN = 'N'
    nameA2 = 'A2'
    nameY = 'Y'
    if parameter_importance[48] > 0:
        nameA += '_start'
    if parameter_importance[45] > 0:
        nameN += '_start'
    if parameter_importance[46] > 0:
        nameA2 += '_start'
    if parameter_importance[47] > 0:
        nameY += '_start'
    if has_A:
        G.add_node(nameA)
    if has_A2:
        G.add_node(nameA2)
    if has_N:
        G.add_node(nameN)
    if has_Y:
        G.add_node(nameY)
    if (parameter_importance[25]>0) or (parameter_importance[26]>0) or (parameter_importance[27]>0):
        G.add_edge(nameA, nameA2)
    if (parameter_importance[28]>0) or (parameter_importance[29]>0) or (parameter_importance[30]>0):
        G.add_edge(nameA, nameN)
    if (parameter_importance[31]>0) or (parameter_importance[32]>0) or (parameter_importance[33]>0):
        G.add_edge(nameA2, nameY)
    if (parameter_importance[34]>0) or (parameter_importance[35]>0) or (parameter_importance[36]>0):
        G.add_edge(nameN, nameY)
    if parameter_importance[37]>0:
        G.add_edge(nameN, nameA2)  # 37
    if parameter_importance[38]>0:
        G.add_edge(nameA, nameY)  # 38
    if parameter_importance[39]>0:
        G.add_edge(nameA2, nameN)  # 39
    if parameter_importance[40]>0:
        G.add_edge(nameY, nameA)  # 40
    if parameter_importance[41]>0:
        G.add_edge(nameN, nameA)  # 41
    if parameter_importance[42]>0:
        G.add_edge(nameY, nameN)  # 42
    if parameter_importance[43]>0:
        G.add_edge(nameA2, nameA)  # 43
    if parameter_importance[44]>0:
        G.add_edge(nameY, nameA2)  # 44

