# Rules for subtype presence - a subtype either has to be initiating OR transitioned to
# (lines 942-1015 are the same as 310-383 - it's the same code but shown again for this example)

topop = []
for n,i in enumerate(modelstr_list):
    if n % 5000 == 0:
        print(str(n)+' out of '+str(len(modelstr_list)))
    x = [int(j) for j in i.split(',')]
    #print(x)
    z = {y:1 for y in x}
    z.update({y:0 for y in set(range(1,52+1)).difference(set([x for x in z]))})
    #
    G = nx.MultiDiGraph(self_loops=True)
    add_to_nx_graph_tocheckaccess(G,z)
    allaccessible = []
    for j in [x for x in G.nodes if not 'start' in x]:
        toAdd = False
        for k in [x for x in G.nodes if 'start' in x]:
            #print('can '+j+' be reached by '+k)
            #print(nx.has_path(G,k,j))
            if nx.has_path(G,k,j):
                toAdd = True
        allaccessible.append(toAdd)
    if not np.all(allaccessible):
        topop.append(n)

topop = list(set(topop))
newmodelstr_list = [i for j, i in enumerate(modelstr_list) if j not in topop]
modelstr_list = newmodelstr_list
del newmodelstr_list

## Continue through topology strings and remove ones that don't fit the rules - here would be effect type
#  at this point some of these if statements wouldnt apply for this three-subtype topology, but keeping them for further propagation for other three- and then four-subtype
topop = []
for n,i in enumerate(modelstr_list):
    if n % 5000 == 0:
        print(str(n)+' out of '+str(len(modelstr_list)))
    x = [int(j) for j in i.split(',')]
    if (1 in x or 7 in x or 13 in x or 19 in x) and (26 in x or 29 in x or 32 in x or 35 in x):
        topop.append(n)
    if (2 in x or 8 in x or 14 in x or 20 in x) and (25 in x or 28 in x or 31 in x or 34 in x):
        topop.append(n)
    if (26 in x or 29 in x or 32 in x or 35 in x) and (25 in x or 28 in x or 31 in x or 34 in x):
        topop.append(n)
    if (19 not in x) and (1 in x or 7 in x or 13 in x):
        topop.append(n)
    if (19 not in x and 21 not in x) and (25 in x or 28 in x):
        topop.append(n)
    if (14 not in x) and (2 in x or 8 in x or 20 in x):
        topop.append(n)
    if (14 not in x and 15 not in x) and (29 in x or 35 in x):
        topop.append(n)
    if (14 in x and 20 in x and not 2 in x and not 8 in x):
        topop.append(n)
    if (37 in x and not 39 in x) or (39 in x and not 37 in x):
        topop.append(n)
    # if A->A2 is affected or not affected by a particular thing, A->N must also be affected by that same thing (not true for A->A2 compared to A2->Y though)
    if (25 in x and (29 in x or 30 in x)) or (26 in x and (28 in x or 30 in x)) or (27 in x and (28 in x or 29 in x)):
        topop.append(n)
    # and for A->N
    if (28 in x and (26 in x or 27 in x)) or (29 in x and (25 in x or 27 in x)) or (30 in x and (25 in x or 26 in x)):
        topop.append(n)
    # A2->Y and N->Y need to match as well
    if (31 in x and (35 in x or 36 in x)) or (32 in x and (34 in x or 36 in x)) or (33 in x and (34 in x or 35 in x)):
        topop.append(n)
    if (34 in x and (32 in x or 33 in x)) or (35 in x and (31 in x or 33 in x)) or (36 in x and (31 in x or 32 in x)):
        topop.append(n)
    # if N or A2 transition to Y is present, and any transition from A to N or A2 is present
    if (31 in x or 32 in x or 34 in x or 35 in x) and (25 in x or 26 in x or 27 in x or 28 in x or 29 in x or 30 in x):
        # then the N or A2 transition to Y can only be affected if the transition from A to N or A2 is affected
        if (31 in x or 32 in x or 34 in x or 35 in x) and not (25 in x or 26 in x or 28 in x or 29 in x):
            topop.append(n)

