# Remove non-matching effects

topop = []
for n,i in enumerate(modelstr_list):
    if n % 5000 == 0:
        print(str(n)+' out of '+str(len(modelstr_list)))
    x = [int(j) for j in i.split(',')]
    if (1 in x or 7 in x or 13 in x or 19 in x) and (26 in x or 29 in x or 32 in x or 35 in x):
        topop.append(n)
    if (2 in x or 8 in x or 14 in x or 20 in x) and (25 in x or 28 in x or 31 in x or 34 in x):
        topop.append(n)
    if (26 in x or 29 in x or 32 in x or 35 in x) and (25 in x or 28 in x or 31 in x or 34 in x):
        topop.append(n)
    if (19 not in x) and (1 in x or 7 in x or 13 in x):
        topop.append(n)
    if (19 not in x and 21 not in x) and (25 in x or 28 in x):
        topop.append(n)
    if (14 not in x) and (2 in x or 8 in x or 20 in x):
        topop.append(n)
    if (14 not in x and 15 not in x) and (29 in x or 35 in x):
        topop.append(n)
    if (14 in x and 20 in x and not 2 in x and not 8 in x):
        topop.append(n)
    if (37 in x and not 39 in x) or (39 in x and not 37 in x):
        topop.append(n)
    # if A->A2 is affected or not affected by a particular thing, A->N must also be affected by that same thing (not true for A->A2 compared to A2->Y though)
    if (25 in x and (29 in x or 30 in x)) or (26 in x and (28 in x or 30 in x)) or (27 in x and (28 in x or 29 in x)):
        topop.append(n)
    # and for A->N
    if (28 in x and (26 in x or 27 in x)) or (29 in x and (25 in x or 27 in x)) or (30 in x and (25 in x or 26 in x)):
        topop.append(n)
    # A2->Y and N->Y need to match as well
    if (31 in x and (35 in x or 36 in x)) or (32 in x and (34 in x or 36 in x)) or (33 in x and (34 in x or 35 in x)):
        topop.append(n)
    if (34 in x and (32 in x or 33 in x)) or (35 in x and (31 in x or 33 in x)) or (36 in x and (31 in x or 32 in x)):
        topop.append(n)
    # if N or A2 transition to Y is present, and any transition from A to N or A2 is present
    if (31 in x or 32 in x or 34 in x or 35 in x) and (25 in x or 26 in x or 27 in x or 28 in x or 29 in x or 30 in x):
        # then the N or A2 transition to Y can only be affected if the transition from A to N or A2 is affected
        if (31 in x or 32 in x or 34 in x or 35 in x) and not (25 in x or 26 in x or 28 in x or 29 in x):
            topop.append(n)

topop = list(set(topop))
newmodelstr_list = [i for j, i in enumerate(modelstr_list) if j not in topop]
modelstr_list = newmodelstr_list
del newmodelstr_list

## For four-subtype models, do some more removals based on bidirectional transition symmetry requirements
#       Must have *both* early-transitions (A->N, A->A2) bidirectional if either is bidirectional at all, same for late-transitions (N->Y, A2->Y)
#       And if either set (early- or late-transitions) are bidirectional, A->Y must be bidirectional (A<->Y)

topop = []
for n,i in enumerate(modelstr_list):
    if n % 5000 == 0:
        print(str(n)+' out of '+str(len(modelstr_list)))
    x = [int(j) for j in i.split(',')]
    # if the A <-> N bidirectional transition is there, and A->A2 is present, the bidirectional A<->A2 transition needs to be the case
    # and vice versa with A <-> A2
    if ((41 in x and (25 in x or 26 in x or 27 in x)) and not 43 in x) or ((43 in x and (28 in x or 29 in x or 30 in x)) and not 41 in x):
        topop.append(n)
    if ((42 in x and (31 in x or 32 in x or 33 in x)) and not 44 in x) or ((44 in x and (34 in x or 35 in x or 36 in x)) and not 42 in x):
        topop.append(n)
    # first half transitions or second half transitions need to match (presence-wise)
    if (25 in x or 26 in x or 27 in x) and not (28 in x or 29 in x or 30 in x):
        topop.append(n)
    if (28 in x or 29 in x or 30 in x) and not (25 in x or 26 in x or 27 in x):
        topop.append(n)
    if (31 in x or 32 in x or 33 in x) and not (34 in x or 35 in x or 36 in x):
        topop.append(n)
    if (34 in x or 35 in x or 36 in x) and not (31 in x or 32 in x or 33 in x):
        topop.append(n)
    # If early-transitions are two ways, A->Y HAS to be two-ways
    if ((25 in x or 26 in x or 27 in x) and (28 in x or 29 in x or 30 in x)) and not ((31 in x or 32 in x or 33 in x) or (34 in x or 35 in x or 36 in x)):
        # if we know that A->N and A->A2 are present by themselves (thus had to add on "but not N->Y or A2->Y" for clarification)
        if 40 in x and not (41 in x or 43 in x):
            # if there's A<->Y but no A<->N or A<->A2
            topop.append(n)
        if 41 in x and 43 in x and (38 in x and not 40 in x):
            # if there's A<->N and A<->A2 but ONLY A->Y
            topop.append(n)
    # If late-transitions are two ways, A->Y HAS to be two-ways
    if ((31 in x or 32 in x or 33 in x) and (34 in x or 35 in x or 36 in x)) and not ((25 in x or 26 in x or 27 in x) or (28 in x or 29 in x or 30 in x)):
        # if we know that N->Y and A2->Y are present (had to add on "but not A->N or A->A2" for clarification)
        if 40 in x and not (42 in x or 44 in x):
            # if there's A<->Y but no N<->Y or A2<->Y
            topop.append(n)
        if 42 in x and 44 in x and (38 in x and not 40 in x):
            # if there's N<->Y and A2<->Y but ONLY A->Y
            topop.append(n)
    #i feel like these are likely repetitive...
    if ((31 in x or 32 in x or 33 in x) and (34 in x or 35 in x or 36 in x)) and ((25 in x or 26 in x or 27 in x) and (28 in x or 29 in x or 30 in x)):
        # if we know that A->N->Y and A->A2->Y are present
        if 40 in x and not ((41 in x and 43 in x) or (42 in x and 44 in x)):
            # if there's A<->Y but no A<->N<->Y or A<->A2<->Y
            topop.append(n)
        if ((41 in x and 43 in x) or (42 in x and 44 in x)) and (38 in x and not 40 in x):
            # if there's A<->N<->Y or A<->A2<->Y but ONLY A->Y
            topop.append(n)
    # if all 4 "hierarchical" transitions are bidirectional, A<->Y should be bidirectional
    if (41 in x and 42 in x and 43 in x and 44 in x) and 38 in x:
        # if all four bidirectional transitions are there, and A->Y is present
        if not 40 in x:
            # then it has to be A<->Y
            topop.append(n)
    # if N or A2 transition to Y is present, and any transition from A to N or A2 is present
    if (31 in x or 32 in x or 34 in x or 35 in x) and (25 in x or 26 in x or 27 in x or 28 in x or 29 in x or 30 in x):
        # then the N or A2 transition to Y can only be affected if the transition from A to N or A2 is affected
        if (31 in x or 32 in x or 34 in x or 35 in x) and not (25 in x or 26 in x or 28 in x or 29 in x):
            topop.append(n)
    # make sure if one of the transitions is not affected but others are, it's removed
    if (27 in x and (28 in x or 29 in x)) or (30 in x and (25 in x or 26 in x)) or (33 in x and (34 in x or 35 in x)) or (36 in x and (31 in x or 32 in x)):
        topop.append(n)

topop = list(set(topop))
newmodelstr_list = [i for j, i in enumerate(modelstr_list) if j not in topop]
modelstr_list = newmodelstr_list
del newmodelstr_list

